import React from 'react';
import './App.css';

function AboutUs() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          ABOUT US
        </h1>
        <p>
          We are specialists in IT Contracting and website building.
        </p>
      </header>
    </div>
  );
}

export default AboutUs;
